import React, { Component } from "react";
import NavbarRR from './components/navbar'
import Month from './components/month'

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <NavbarRR />
        <Month />
      </React.Fragment>
    );
  }
}

export default App;
